// src/components/LandingPage.jsx
import React from 'react';
import group49 from '../assets/group-490.svg';
import landingBackground from '../assets/landing-page.png'; // Add this image in /src/assets/

const LandingPage = () => {
  return (
    <div
      className="relative h-[800px] overflow-hidden"
      style={{
        backgroundImage: `url(${landingBackground})`,
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
      }}
    >
      <div className="absolute left-[715px] top-[557px] w-[488px] h-[129px] bg-[#130e2a] rounded-[24px] flex items-center justify-center p-[30px_20px]">
        <div className="text-white text-[34px] font-semibold text-center">Kiosk</div>
      </div>

      <div className="absolute left-[112px] top-[557px] w-[488px] h-[129px] bg-[#130e2a] rounded-[24px] flex items-center justify-center p-[30px_20px]">
        <div className="text-white text-[34px] font-semibold text-center">
          Super Admin<br />Dashboard
        </div>
      </div>

      <div className="absolute left-[112px] top-[362px] w-[488px] h-[129px] bg-[#130e2a] rounded-[24px] flex items-center justify-center p-[30px_20px]">
        <div className="text-white text-[34px] font-semibold text-center">
          Security<br />Dashboard
        </div>
      </div>

      <div className="absolute left-[698px] top-[362px] w-[488px] h-[129px] bg-[#130e2a] rounded-[24px] flex items-center justify-center p-[30px_20px]">
        <div className="text-white text-[34px] font-semibold text-center">
          Resident<br />Dashboard
        </div>
      </div>

      <img
        src={group49}
        alt="Decorative"
        className="absolute top-[181px] left-[565px] aspect-[150/130.29] h-auto"
      />
    </div>
  );
};

export default LandingPage;
